    const [list2, setList2] = useState([]);

    useEffect(()=>{
        fetch("http://127.0.0.1:8081/getFinishedTasks")
        .then(response => response.json())
        .then(setList2);
    }, []);

    function handleCheckUncheck() {

    }

    return (
        
        <div style={{display: 'flex', flexWrap: 'wrap', justifyContent: 'space-between'}}>
           {list2.map(todo => 
            <div style={{border: '1px solid grey', margin: '10px', padding: '3px', 
            paddingRight: '5px', paddingBottom: '5px'}}  
            key={todo.id} >
                <input checked type={'checkbox'} onChange={handleCheckUncheck} id={'cb_' + todo.id} />  
                <span style={{textDecoration: 'line-through'}}>{todo.description}</span>
                <button className={'modifybuttons'}>edit</button>
                <button className={'modifybuttons'}>del</button>
            </div>)}
         </div>
       );
    
}

export default List2;
